import React from 'react';
import { Link } from 'react-router-dom';
import './home.css'; // Import the CSS file

function Home() {
  return (
    <div className="container">
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        </ul>
      </nav>
      <h1>Welcome to the Stocks App!</h1>
      <p>This is the home page.</p>
    </div>
  );
}

export default Home;
